    COALESCE(SUM(total_billed_charges) FILTER (WHERE billed_date >= date_trunc('year', CURRENT_DATE)), 0)::NUMERIC AS total_billed_this_year
  FROM public.bills
  WHERE billed_date IS NOT NULL;
END;
$$;


