CREATE PROCEDURE public.get_patient_visits_dynamic(INOUT result refcursor DEFAULT 'result'::refcursor)
    LANGUAGE plpgsql
    AS $$
DECLARE
    query text;
    col_list text;
    pivot_query text;
BEGIN
    -- Get all distinct location names (sanitized for column names)
    SELECT string_agg(
        format(
            'COALESCE(MAX(CASE WHEN location = %L THEN patient_count END), 0) AS %I',
            name,
            regexp_replace(name, '[^a-zA-Z0-9_]', '_', 'g')
        ), ', '
    ) INTO col_list
    FROM (SELECT DISTINCT name FROM locations ORDER BY name) t;
    
    -- Build the complete dynamic pivot query
    query := format('
        WITH patient_data AS (
            SELECT 
                pll.visit_date AS date,
                l.name AS location,
                COUNT(DISTINCT patient_id) AS patient_count
            FROM 
                patient_location_log pll
            JOIN 
                locations l ON pll.location_id = l.id
            GROUP BY 
                pll.visit_date, l.name
        )
        SELECT 
            date, %s
        FROM 
            patient_data
        GROUP BY 
            date
        ORDER BY 
            date',
        col_list
    );
    
    -- Open the cursor with the dynamic query
    OPEN result FOR EXECUTE query;
END;
$$;


